and government web portals   enterprise web applications  full-featured eCommerce sites  online brochure and catalog sites  small business sites  nonprofit web sites  personal and corporate weblogs   Dedicated to Open Source \n TYPO3 is maintained by a nonprofit core development team and an active worldwide community of users. TYPO3 operates under the  GPL license .'),(27979961,'Tables ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works , Content elements RTE table    Caption       Gebiet A    Gebiet B    Gebiet C        2008     							50.000     							50.000     							50.000      2009     							50.000     							50.000     							50.000         Table layout 1  \n				 \n					 Caption  \n					 \n							   \n							 Gebiet A \n							 Gebiet B \n							 Gebiet C \n					 \n					 \n					 \n					 \n							 2009 \n							 54.000 \n							 41.000 \n							 62.000 \n					   \n					 \n							 2007 \n							 50.000 \n							 35.000 \n							 62.400 \n					 \n					 \n							 2008 \n							 52.500 \n							 39.700 \n							 61.500 \n					  \n				     Table layout 2  \n				 \n					 \n							   \n							 Gebiet A \n							 Gebiet B \n							 Gebiet C \n					 \n					 \n							 2007 \n							 50.000 \n							 35.000 \n							 62.400 \n					 \n					 \n							 2008 \n							 52.500 \n							 39.700 \n							 61.500 \n					 \n					 \n							 2009 \n							 54.000 \n							 41.000 \n							 62.000 \n					 \n				     Table layout 3  \n				 \n					 \n							   \n							 Gebiet A \n							 Gebiet B \n							 Gebiet C \n					 \n					 \n							 2007 \n							 50.000 \n							 35.000 \n							 62.400 \n					 \n					 \n							 2008 \n							 52.500 \n							 39.700 \n							 61.500 \n					 \n					 \n							 2009 \n							 54.000 \n							 41.000 \n							 62.000'),(32314300,'Any language, any character ,