 \n Help is also available through Internet Relay Chat on the TYPO3 IRC Channel. If you want to join, log in to your  favorite IRC client and direct it to irc.freenode.net, channel #typo3.\r \n For more help in developing your project with TYPO3, consider also the services of one of many approved consultancies that offer professional help with TYPO3 projects.'),(38657581,'Any login page ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works ,TYPO3, introduction package, install, demo site, example setup, content management, enterprise '),(41054942,'Protected customer page ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works , TYPO3, introduction package, install, demo site, example setup, content management, enterprise '),(48560649,'News   All news articles  \r\n \r\n\r\n	\r\n			 				\r\n			   \r\n Monday 16. of November 2009 \r\n Lorem ipsum dolor sit amet  \r\n			    \r\n			   Vivamus elementum dui vitae turpis ultrices aliquam volutpat justo accumsan. Pellentesque quis ligula sed purus aliquam blandit. Aliquam quis magna enim.  \r\n			  Category: General   \r\n			  >>  \r\n\r\n  \r\n		\r\n			 				\r\n			   \r\n Monday 16. of November 2009 \r\n Vivamus elementum dui   \r\n			    \r\n			   Vivamus elementum dui vitae turpis ultrices aliquam volutpat justo accumsan. Pellentesque quis ligula sed purus aliquam blandit. Aliquam quis magna enim.  \r\n			  Category: Research   \r\n			  >>  \r\n\r\n  \r\n		\r\n			 				\r\n			   \r\n Monday 16. of November 2009 \r\n Pellentesque quis ligula sed purus  \r\n			    \r\n			   Vivamus elementum dui vitae turpis ultrices aliquam volutpat justo accumsan. Pellentesq