e integrated at every level of the system’s architecture.\r \n Granular Front-end and Back-end Access Rights \n All front-end pages and content can be limited to specific front-end user groups. Backend editors can easily be limited to specific sections of the page tree, modules, and directories in the file system.\r \n No Front-end Design Constraints \n Because the TYPO3 front-end and back-end are separate and distinct interfaces, developers have complete and total control of their front-end markup, CSS, and javascript, down to the most minute details.\r \n Front-end Editing \n While the backend offers complete control over all site content, TYPO3 also includes a front-end editing interface for even faster, more intuitive content management by nontechnical editors.\r \n Enterprise Features \n In addition to everything you’d expect in a sophisticated content management system, TYPO3 also possesses a number of important enterprise features including content-specific caching backends, a database abstraction layer, documented serviced-based APIs for authentication, well-defined interfaces for third-party systems integration, reporting tools, a digital assets manager, and an interface for scheduled jobs.  \r \n And More... \n For a full list of all that the TYPO3 core has to offer, take a look at the feature matrix on typo3.com. Or browse the list of over 4,500 extensions on the TYPO3 extension repository.'),(54995076,'File downloads ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works , Content elements Download no icon, no filesize       TYPO3_Logo_Guide_v3.pdf         Download with icon, no filesize            TYPO3_Logo_Guide_v3.pdf         Download with icon and filesize            TYPO3_Logo_Guide_v3.pdf    206 K       Download with icon, filesize and description            TYPO3_L