ons. All TYPO3 sites are built on top of the TYPO3 core, which contains the system\'s fundamental functionality. Custom extensions interact with the core through the stable, clearly documented extension API. While the TYPO3 core does change in each new release, the interfaces between extensions and the core do not, ensuring easy updates and future-proof development.    The TYPO3 Extension Manager \n TYPO3 relies on the TYPO3 extension manager— included in the TYPO3 core—for installing, activating, and deactivating extensions on a given TYPO3 installation. Extensions can be quickly imported and installed with just a couple clicks in the TYPO3 backend.\r \n Kickstarter Simplifies Extension Development \n The extension kickstarter significantly reduces the time required to create a new TYPO3 extension, and automates the creation of interfaces for custom database records in the TYPO3 backend.\r \n ExtBase: TYPO3\'s Built-in MVC Framework \n Recent versions of TYPO3 include a built-in Model-View-Controller (MVC) framework called extBase, which allows developers to take advantage of this popular PHP design pattern. \r \n Extensive Configuration Options \n Nearly every aspect of the TYPO3 backend is configurable and customizable. Backend interfaces can often be configured using TSConfig. Nearly all rendered HTML content can be configured using Typoscript, a declarative configuration language used throughout TYPO3 for controlling front-end output.'),(84776878,'Consultancies ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works , TYPO3, introduction package, install, demo site, example setup, content management, enterprise Need Help? Tap into the TYPO3 Consultancy Network   Many of TYPO3\'s most knowledgeable contributors are the web developers and consultants around the world who use it everyday. These  certified consultants  are among the most active members of the TYPO3 community and offer proven professional services—whether you simply need help with hosting or a complete development strategy for building a new website.'),(88605078,'Examples ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works , TYPO3, introduction package, install, demo site, example setup, content management, enterprise Content Management Made Easy   To help get you started with TYPO3, we’ve included usage examples of the core content elements that have made TYPO3 so popular.     These examples illustrate how straight out-of-the-box, TYPO3 delivers a vast amount of freedom to content editors. Unlike more static content management systems, TYPO3 content management is highly object-oriented and granular. Click on any of the links in the secondary navigation, to the left, to see examples of each core content element.\r \n Feel free to log into the TYPO3 backend to see how easily these content elements (and pages) can be created, deleted, and modified!'),(89245927,'Frames ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works , Content elements Content-specific Layouts   Frames  are centrally configured layouts for different content elements. Frames can be used, for example, to allow a content editor to apply a specific background image and/or color to specific content elements throughout the website.     Ruler before   You can set a rulers before or after each content element.     Ruler after   Here the ruler is positioned after the element.     Indent   Donec volutpat pulvinar enim tincidunt sagittis. Duis rutrum enim