ind TYPO3’s development is its expanding, vibrant community of nearly 100,000 members. Over the past decade, TYPO3 has been installed more than 500,000 times, and these numbers are growing daily. This truly international community is composed of individuals and consultancies working with TYPO3 in countries across the world.     Community Events   There are a number of recurring TYPO3 events and conferences. Each year, the TYPO3 Association organizes a snowboard tour in the mountains of central Europe, giving TYPO3 developers an opportunity to meet face-to-face. Furthermore, there is an annual “Developer Days” event that aims to give PHP developers a chance to collaborate and focus on the TYPO3 core.\r \n There are annual conferences held in the US and in Europe with talks aimed at PHP developers, site integrators, and web marketers. Many regions also host active TYPO3 usergroups, which are invaluable sources of shared knowledge.'),(93199155,'Welcome to TYPO3 ,This website is a default website setup for TYPO3. You can use it to demonstrate the basic features of the TYPO3 Content Management System, but you are also welcome to use it as a basis for your own website projects. Please have a look at how it works and how it is structured. In building this package, we have tried to combine a lot of best practices. Feel free to use these structures and use elements of it for your own way of working. ,typo3, introduction package, install, demo site, example setup Welcome to TYPO3   Diese Website dient der Pr?sentation der TYPO3 Testsite f?r das Content Management System (CMS) TYPO3.\r \n Do we have any encoding problems? ? ? ? ???\r \n Die TYPO3 Testsite ist bewusst einfach gehalten, um den Einstieg in TYPO3 zu erleichtern. Diese bietet somit die optimale Voraussetzung, um TYPO3 zu testen oder eine eigene Internetseite zu erstellen.\r \n Die TYPO3 Testsite ist kostenlos. ?ber eine Namensnennung und R?ckverlinkung w?rde ich mich sehr freuen.\r \n Hier geht es zum Download der  TYPO3 Testsite .     Test header    test content  test content  test content  test content  test content  test content \r \n   \n  test content  test content  test content  test content  test content  test content      TYPO3 Testsite      Kontakt   Bei Fragen, Hinweisen oder Anregungen nehmen Sie bitte mit uns  Kontakt  auf.'),(95671238,'Resources ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works , TYPO3, introduction package, install, demo site, example setup, content management, enterprise TYPO3: A True Open Source Community   A widespread, international community of users and developers contributes to the ongoing evolution and success of TYPO3. Get acquainted with the latest enhancements, view tutorials, screen shots, and sample sites at the hub of the TYPO3 community—TYPO3.org. Follow some of the links below to connect with like-minded users and developers.    Core Team \n Development and maintenance of TYPO3—and all of its built-in modules and features—is led by the core team, a group of 30 volunteers and developers sponsored, in part, by the non-profit TYPO3 Association.\r \n Extension Developers \n The 4,500+ extensions of TYPO3 are created by savvy, enthusiastic users (like you!), and can be found in the vast TYPO3 Extension Repository (TER). Here you will find everything from simple site templates to advanced plug-ins as well as user-generated documentation and tutorials.\r \n Finding Help \n Active mailing lists are the heart of the TYPO3 open source community. Here you can ask questions, and seek out users who are engaged in similar projects or interests. There are hundreds of subscribers to the user list and most questions generate a helpful, timely response. Subscribe today and start meeting other members of the TYPO3 community.\r \n Help is also available through Internet Relay Chat on the TYPO3 IRC Channel. If you want to join, log in to your  favorite IRC client and direct it to irc.freenode.net, channel #typo3.\r \n For more help in developing your project with TYPO3, consider also the services of one of many approved consultancies that offer professional help with TYPO3 projects.'),(112269630,'The TYPO3 Association is founded ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works , TYPO3, introduction package, install, demo site, example setup, content management, enterprise 09/16/2004 17:33 \r\n	 The TYPO3 Association is founded \r\n	 Category: Research   \r\n	\r\n	 Months in the planning, on this very day the TYPO3 Association was founded by a group of long-time contributors headed by Kasper Skårhøj. \r\n	 \r\n	 Months in the planning, on this very day the TYPO3 Association was founded by a group of long-time contributors headed by Kasper Skårhøj. The Association is located in Switzerland and will act as a heart of the project by funding development of the system\'s core, providing certficiation and representing the project officially. \r \n  Goals and Objectives      Fostering development of TYPO3;  Organisation of events for the purpose of information and education of its members;  Supporting the adaption of international software standards within TYPO3;  Education and certification to ensure quality of service;  Communication with its members and the general public, to spread and further knowledge and proficiency for the usage of the TYPO3 software, especially by virtue of it’s project website;'),(116404532,'Image groups ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works , Content elements Multiple Image Layout Options   TYPO3 provides users with numerous possibilities for laying out images on a page. The back-end interface provides users with easy control over image formats, sizes, widths, groupings, and quality.     6 images in 6 columns         Image 1 \r       Image 2 \r       Image 3 \r       Image 4 \r       Image 5 \r       Image 6             6 images in 3 columns          Image 1 \r       Image 2 \r       Image 3 \r         Image 4 \r       Image 5 \r       Image 6              Fixed height for images with different width-height ratio                                         Fixed width for images with different width-height ratio                                         Fixed width and \"no rows\"  flagged'),(116627476,'Examples of Rich Text ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works , Content elements TYPO3\'s Built-in Rich Text Editor   TYPO3 contains a sophisticated, built-in rich text editor (RTE). This editor contains all of the features one would expect from an enterprise CMS, and is highly configurable.     Examples of Rich Text Content Elements     Continuous text:  text, optional in  bold  or  italic  or in a combination of   bold and italic  . \r \n  Special characters can be used : @ © ® ¢ ¼ ½ ¾ § ± a² m³ Ω π µ γ β α H 2 O\r \n  Texts in foreign languages can be mixed on one page.   The font has to be installed on the device though:\r \n cyrillic: Русская версия  chinese: 中文版 arabic:  الْعَرَبيّة  \r \n Centered text \n Text justified right \n Bulleted list:    first level   first level  second level  second level  third level  third level        Ordered list:     first level   first level  second level  second level  third level  third level        Indented paragraph:    Aenean ante elit, elementum