e helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works ,TYPO3, introduction package, install, demo site, example setup, content management, enterprise Great things take time!   TYPO3 is nothing new or specifically trendy like many other Open Source tools that have risen in popularity recently because they focus strongly on Web 2.0 or blogging. In fact TYPO3 is a fully grown-enterprise CMS that can be used for virtually anything on the net and features a large set of functionalities grown and improved in functionality over more than a decade. It has been widely adopted by companies of all sizes throughout the world and is an established standard throughout many universities, governments and organizations.  TYPO3\'s development was started from scratch by Kasper Skårhøj in 1997. The term \"Content Management\" was still widely unknown. As you can see by the huge amount of CMSes on the market today, the idea of content management was a straight forward solution to an emerging problem for the young internet - as websites grew and the complexity of them increased, the need for separation of design and content was inevitable. \r \n Over the last decade TYPO3 has grown more feature-rich and powerful to the point it is today, where we can call it close to being feature-complete. \r \n       A little anecdote about the name \"TYPO3\"   Its creator Kasper Skårhøj remembers it happening something like this…\r \n Back in the late 1990s, while still working on the initial version, he was looking for a name for the new software. At the time, the name “freestyle” appealed to him, but it posed some problems through its over-association with certain activities, products and trademarks. So the issue of naming stayed on the back burner for want of a better idea. \r \n Then, one Friday evening while he was alone in the building after hours entering code, a lapse of concentration resulted in Kasper inadvertently typing an error into the command line of his Linux server and accidentally deleting a whole week’s worth of programming. He recalls that feeling you get of a cold rush through your entire body, when you realize something dreadful has happened. Slowly he got up, walked to the other end of the room and sat down in the couch looking back across the office at the laptop perched innocently on his desk. \r \n He stayed like this for a while, just staring emptily out into the room. Then, after the initial shock had subsided he walked back, sat down and began to recreate the lost code. This went surprisingly quickly; as such things do when you have them fully worked out in your head. And it was during this new rush of adrenaline and the satisfaction that all was not actually lost that he began to put the incident into a better perspective. The recreated programming was going smoothly and cleanly, which made him wonder how ironic it would be if a typo ended up actually improving the product! It was this thought that first brought up the expression “typo” as a possible name. It seemed to fit especially well because a) “typo”, as in typography, had something to do with layout and content and b) “typo”, as in spelling mistake, now had a quirky share in the product’s history. The newborn child now had a name. \r \n Originally there were Typo versions 1, 2 and 2.5. But with the enduring success of version 3, which had branded itself more or less by default, a “3” was eventually appended to the product title. Since the launch of “TYPO3 version 4”, it has been finally settled that TYPO3 will remain as the product name for the version 4 and the version 5 issue and all future versions. So, TYPO3 it is … and TYPO3 it stays.'),(123427353,'Any login page ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works , TYPO3, introduction package, install, demo site, example setup, content management, enterprise '),(125853710,'News ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works ,TYPO3, introduction package, install, demo site, example setup, content management, enterprise Skip to navigation  \r\n      Skip to content  \r\n   \r\n  \r\n  \r\n    \n	  Introduction Package  \r\n        Customer login    \r\n      \r\n       \r\n    \r\n    \r\n	 First Level Navigation \r\n	    Get Started    About TYPO3    Editor features    Standard features    Extending features    News    Give Feedback    \r\n    \r\n    \r\n      \r\n       Second Level Navigation \r\n        \r\n          \r\n      \r\n      \r\n        Home  »  News  »    \r\n       no news_id given \r\n      \r\n      \r\n              Latest news  \r\n \r\n	\r\n			 \r\n				  TYPO3 celebrates 20th anniversary  \r\n				 TYPO3 celebrates it\'s 20th anniversary. Having been one of the very... \r\n				 >> \r\n			 \r\n\r\n		\r\n			 \r\n				  T3UXW09 - The first TYPO3 User eXperience Week  \r\n				 30 attendants for the T3UXW09 have arrived in rural Behringen... \r\n				 >> \r\n			 \r\n\r\n		\r\n			 \r\n				  The TYPO3 Association is founded  \r\n				 Months in the planning, on this very day the TYPO3 Association was... \r\n				 >> \r\n			 \r\n\r\n		\r\n \r\n  \r\n      \r\n    \r\n    \r\n     Footer \r\n            Published by   TYPO3 Version 4.4 Content Management System Inspiring people to collaborate    Donate    TYPO3.org          Related Links    TYPO3 Documentation   TYPO3 Books   TYPO3 Mailing Lists   TYPO3 Usergroups   TYPO3 Events   TYPO3 Wiki          TYPO3 in social networks'),(134246624,'Any language, any character ,This TYPO3 Introduction Packa