 content can be limited to specific front-end user groups. Back-end editors can easily be restricted to specific sections of the page tree, modules, and directories in the file system.\r \n No Front-end Design Constraints \n Because the TYPO3 front-end and back-end are separate and distinct interfaces, developers have complete and total control of their front-end markup, CSS, and javascript, down to the most minute details.\r \n Front-end Editing \n While the back-end offers complete control over all site content, TYPO3 also includes a front-end editing interface for even faster, more intuitive content management by nontechnical editors.\r \n Enterprise Features \n In addition to everything one would expect in a sophisticated content management system, TYPO3 also possesses a number of important enterprise features including content-specific caching backends, a database abstraction layer, documented serviced-based APIs for authentication, well-defined interfaces for third-party systems integration, reporting tools, a digital asset manager, and an interface for scheduled jobs.  \r \n And More... \n For a full list of all that the TYPO3 core has to offer, take a look at the feature matrix on typo3.com. Or browse the list of over 4,500 extensions on the TYPO3 extension repository.'),(144359339,'TYPO3 celebrates 20th anniversary ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works ,TYPO3, introduction package, install, demo site, example setup, content management, enterprise 06/16/2017 17:33 \r\n	 TYPO3 celebrates 20th anniversary \r\n	 Category: General   \r\n	\r\n	 TYPO3 celebrates it\'s 20th anniversary. Having been one of the very first Content Management Systems on the market 20 years of market leadership... \r\n	 \r\n	 TYPO3 celebrates it\'s 20th anniversary. Having been one of the very first Content Management Systems on the market 20 years of market leadership is an achievement truly worth celebrating.\r \n Let\'s take a minute to reflect on the 20 years passed:\r \n 1997: The idea for TYPO3 is born 2000: The TYPO3 community is born 2005: the first TYPO3 conference is held 2008: TYPO3 reaches a market share of close to 40% in central Europe 2010: TYPO3 5.0 shakes up the CMS world 2014: 95% of the world\'s websites run on Open Source and 60% on TYPO3 2017: Happy 20th Birthday TYPO3\r \n All the TYPO3 enthusiasts in the world: Keep up the great work!'),(146845407,'Community ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works , TYPO3, introduction package, install, demo site, example setup, content management, enterprise TYPO3: Inspiring People to Share   The real driving force behind TYPO3’s development is its expanding, vibrant community of nearly 100,000 members. Over the past decade, TYPO3 has been installed more than 500,000 times, and these numbers are growing daily. This truly international community is composed of individuals and consultancies working with TYPO3 in countries across the world.     Community Events           Group photo at T3BOARD10 Photo by (c)  Jochen Rau      There are a number of recurring TYPO3 events and conferences. Each year, the TYPO3 Community organizes a snowboard tour \"T3Board\" in the mountains of central Europe, giving TYPO3 developers an opportunity to meet face-to-face. Furthermore, there is an annual \"Developer Days\" event that aims to give PHP developers a chance to collaborate and focus on the TYPO3 core.\r \n There are annual conferences held in the US and in Europe with talks aimed at web marketers, site integrators and developers. Many regions also host active TYPO3 usergroups, which are invaluable sources of shared knowledge.'),(149398503,'T3UXW09 - The first TYPO3 User eXperience Week ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works , TYPO3, introduction package, install, demo site, example setup, content management, enterprise 11/16/2009 17:33 \r\n	 T3UXW09 - The first TYPO3 User eXperience Week \r\n	 Category: General   \r\n	\r\n	 30 attendants for the T3UXW09 have arrived in rural Behringen (Germany) to work on TYPO3\'s usability for one whole week. \r\n	     30 hand-picked specializists participating in the T3UXW09   \r\n	 It is saturday the 14th of november. Almost everyone has arrived at the castle in Behringen at around 2-3 o\'clock in the afternoon. The castle is barrierfree, which means it is all adopted for disabled people. Although we are not working on accessibility I can safely assume most of the attendants support that. The castle itself is situated in a really nice rural environment. The air is really fresh. A welcome change for city dwellers. The whole castle belongs to the team this week. The network team, that rapidly volunteered, set up the whole wireless environment in a few hours. Punkt.de provided the switches they also use for the TYPO3 conferences. Joey brought a monster PC where he virtualised five servers. One for every team. Supportive tools like SVN, IRC and alike where all set up on this machine with the help of various people. Jens Hoffmann welcomed the attendants a little later in the afternoon and split up the available rooms among the attendants. After that the composition of the different teams was announced.'),(149622811,'Resources ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works , TYPO3, introduction package, install, demo site, example setup, content management, enterprise TYPO3: A True Open Source Community   A widespread, international community of users and developers contributes to the ongoing evolution and success of TYPO3. Get acquainted with the latest enhancements, view tutorials, screen shots, and sample sites at the hub of the TYPO3 community— typo3.org . Follow some of the links below to connect with like-minded users and developers.    Core Team \n Development and maintenance of TYPO3—and all of its built-in modules and features—is led by the core team, a group of 30 volunteers and developers sponsored, in part, by the non-profit TYPO3 Association.\r \n Extension Developers \n The  4,500+ extensions  of TYPO3 are created by savvy, enthusiastic users (like you!), and can be found in the vast  TYPO3 Extension Repository  (TER). Here you will find everything from simple site templates to advanced plug-ins as well as user-generated documentation and tutorials.\r \n Finding Help \n  Active mailing lists  are the heart of the TYPO3 open source community. Here you can ask questions, and seek out users who are engaged in similar projects or interests. There are hundreds of subscribers to the user list and most questions generate a helpful, timely response. Subscribe today and start meeting other members of the TYPO3 community.\r \n Help is also available through Internet Relay Chat on the  TYPO3 IRC Channel . If you want to join, log in to your  favorite IRC client and direct it to irc.freenode.net, channel #typo3.\r \n For more help in developing your project with TYPO3, consider also the services of one of many  approved consultancies  that offer professional help with TYPO3 projects.'),(150043169,'typo3_image1.jpg   '),(157731686,'News ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works ,TYPO3, introduction package, install, demo site, example setup, content management, enterprise All news articles  \r\n \r\n\r\n	\r\n			 				\r\n			   \r\n				 11/16/09 \r\n				 Lorem ipsum dolor sit amet \n			   \r\n			    \r\n			    Vivamus elementum dui vitae turpis ultrices aliquam volutpat justo accumsan. Pellentesque quis ligula sed purus aliquam blandit. Aliquam quis magna enim. \n			   >>  \r\n			    Category: General   \r\n			 \r\n		\r\n			 				\r\n			   \r\n				 11/16/09 \r\n				 Vivamus elementum dui  \n			   \r\n			    \r\n			    Vivamus elementum dui vitae turpis ultrices aliquam volutpat justo accumsan. Pellentesque quis ligula sed purus aliquam blandit. Aliquam quis magna enim. \n			   >>  \r\n			    Category: Research   \r\n			 \r\n		\r\n			 				\r\n			   \r\n				 11/16/09 \r\n				 Pellentesque quis ligula sed purus \n			   \r\n			    \r\n			    Vivamus elementum dui vitae turpis ultrices aliquam volutpat justo accumsan. Pellentesque quis ligula sed purus aliquam blandit. Aliquam quis magna enim. \n			   >>  \r\n			    Category: General, Internal   \r\n			 \r\n		\r\n			 				\r\n			   \r\n				 11/16/09 \r\n				 Praesent gravida neque at sem rhoncus \n			   \r\n			    \r\n			    Vivamus elementum dui vitae turpis ultrices aliquam volutpat justo accumsan. Pellentesque quis ligula sed purus aliquam blandit. Aliquam quis magna enim. \n			   >>  \r\n			    Category: Internal, Research, General'),(158064379,'Forms ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works , Content elements Powerful Form Handling   Setting up a contact or mail form is very easy. The layout of forms is handled centrally, which allows editors to focus on the content of the form.            Name      E-mail      Address   \n    Do you want us to get in touch?      Your knowledge    Your knowledge   none    little    much'),(163353051,'TYPO3 - An idea is born ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works , TYPO3, introduction package, install, demo site, example setup, content management, enterprise 02/22/1997 17:33 \r\n	 TYPO3 - An idea is born \r\n	 Category: General   \r\n	\r\n	 Kasper Skårhøj was contracted this week by a Danish company to build a content management solution for their corporate website. \r\n	     TYPO3 Inventor: Kasper Skårhøj   \r\n	 Kasper Skårhøj was contracted today by a Danish company this week to build a content management solution for their corporate website. The term \"Content Management\" is still widely unknown. The idea of content management is a straight forward solution to an emerging problem for the young internet - as websites are going to grow and the complexity of them increase, the need for separation of design and content has become  inevitable.\r \n Over the next months many meetings will define the exact requirements for this new system, enabling the client to manage the content on their website independant from HTML coders.\r \n Stay tuned on what will help with this experiment.'),(163830517,'Headers ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works , Content elements Full Control Over All Content Elements   TYPO3 offers editors full control over all content elements; even simple content elements like headers are accompanied by several configuration options. Site administrators may, for example, predefine several different header layouts for editors to utilize across the site.      Header 1. level      Header 2. level      Header 3. level      Header 4. level      Header 5 level       Header 1. level (with link)        Header 2 level (with link)        Header 3. level (with link)        Header 4. level (with link)        Header 5. level (with link)       Header 1. level (centered)      Header 2. level (centered)      Header 3. level (centered)      Header 4. level (centered)      Header 5. level (centered)      Header 1. level (right-justified)      Header 2. level (right-justified)      Header 3. level (right-justified)      Header 4. level (right-justified)      Header 5. level (right-justified)'),(168651738,'Welcome to TYPO3 ,This website is a default website setup for TYPO3. You can use it to demonstrate the basic features of the TYPO3 Content Management System, but you are also welcome to use it as a basis for your own website projects. Please have a look at how it works and how it is structured. In building this package, we have tried to combine a lot of best practices. Feel free to use these structures and use elements of it for your own way of working. , typo3, introduction package, install, example setup Congratulations , you have succesfully installed TYPO3 \r\n       So&mdash;what\'s next ? \r\n       Grab a cup of coffee and start browsing through this site to learn why TYPO3 is the most powerful open source content management system. \r\n       Check out the sample pages in the \"examples\" section of this website or&hellip; \r\n        Log into TYPO3  \r\n        &mdash; Get involved!'),(171502981,'Text ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works ,TYPO3, introduction package, install, demo site, example setup, content management, enterprise 11/15/09  Texts written in the RTE (Rich Text Editor)   All functions can be configured individually