(258126034,'Documentation ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works , TYPO3, introduction package, install, demo site, example setup, content management, enterprise Extensive Documentation   As a global, user-supported project, documentation for TYPO3 exists in many locations (and, thankfully, in many different languages). For the answer to most questions look first to the central  TYPO3 Document Library  where you will find several useful tutorials, and guides to installation, configuration, and getting started with TYPO3.    TYPO3 Wiki \n Find additional documentation in the  TYPO3 Wiki , which provides how-to guides conveniently classified for different types of TYPO3 users.    Editors  can find documents on how to handle and manage their content.   Administrators  can find documents on how to manage security, users, and fine-tune performance.   Developers  can find how-to guides to get started in creating their own TYPO3 extensions.   TYPO3 API Documentation \n The TYPO3 source code contains abundant internal documentation, which will allow developers to understand many functions and features just by browsing through the various classes and methods. Because TYPO3 uses JavaDoc style documentation, it is possible to automatically create a complete documentation of the TYPO3 core.  Additionally, the  TYPO3 Core APIs  manual from the Documentation Library describes important components of the API, and gives many examples how to use it.'),(260439973,'Feedback ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works , TYPO3, introduction package, install, demo site, example setup, content management, enterprise You Make TYPO3 Better!   TYPO3 has always been about its users and about inspiring people to share. Share your experiences with us. Send us a note. Let us know how we can improve TYPO3 or, even better, let us know how you think you can improve TYPO3. We’re all ears!'),(263393582,'Elke taal, elk karakter ,This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works ,TYPO3, introduction package, install, demo site, example setup, content management, enterprise TYPO3 knows no boundaries   The TYPO3 enterprise content management system supports all languages, characters and encoding. All frontend, backend and database interactions fully support UTF-8.       TYPO3 kent geen grenzen   Lorem ipsum dolor sit amet, consectetur adipiscing elit. Phasellus aliquet magna tincidunt tortor sagittis auctor. Pellentesque sed erat metus. Donec turpis orci, cursus id feugiat ut, pellentesque quis arcu. Ut ante magna, vulputate eget porttitor eu, cursus ut tellus. Suspendisse cursus, ligula id rhoncus lobortis, eros velit pulvinar metus, at tincidunt velit tortor vel tortor. Nam molestie mollis orci eget dapibus. Aliquam sed tincidunt lorem. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed sit amet justo neque. Sed malesuada ultrices tincidunt. Donec porta ultrices nisl et vehicula. Nulla malesuada dui vel dui auctor id tempus lorem consequat. Cras vel diam mi, sit amet semper erat. Donec accumsan massa nunc, vitae placerat odio. Nam augue elit, pulvinar in pellentesque sed, pretium at turpis. Nulla et leo ac enim mattis placerat. Quisque tincidunt tellus non mauris dignissim pharetra.');
