r extensions\r\n	extensiontemplates = fileadmin/default/templates/extensions/\r\n}\r\n\r\nmenu {\r\n	# cat=navigation menus; type=string; label= Top-menu pages: Comma separated list of page id\'s to be included in top-right menu.\r\n	top.pages = 28\r\n}\r\n\r\nplugin.tx_automaketemplate_pi1 {\r\n	# cat=plugin.automaketemplate; type:string; label= HTML template file: Name of the HTML page template file (without path, see contant for filepath.templates)\r\n	templatefile = typo3-intro-template.html\r\n}\r\n\r\nplugin.tt_news {\r\n	# cat=plugin.tt_news; type=string; label= pid_list: Comma separated list of folder id\'s containing which contain news records.\r\n	pid_list = 18\r\n	\r\n	# cat=plugin.tt_news; type=int+; label= singlePid: Default ID of the page containing the tt_news SINGLE-view plugin\r\n	singlePid = 23\r\n	\r\n	# cat=plugin.tt_news; type=int+; label= limit: Default maximum number of items to be shown in LIST-view\r\n	limit = 100\r\n	\r\n	# Date and time formats according to active locales\r\n	dateformat = %x\r\n	dateandtimeformat = %c\r\n	\r\n	# Short notation date format according to international ISO standard\r\n	shortdateformat = %Y-%m-%d\r\n	timeformat = %H:%M\r\n}\r\n\r\nplugin.tx_indexedsearch {\r\n	# cat=plugin.indexed_search; type=int+; label= Search Page ID: UID of the page which contains the indexed search plugin.\r\n	searchpageID = 17\r\n}\r\n\r\nplugin.meta {\r\n	# cat=plugin.meta; type=string; label= Description: Write a short abstract for your website.\r\n	description = This TYPO3 Introduction Package helps you to get started with TYPO3. It provides a basic website setup with examples for the most used features. On top of that, this package contains many helpful comments and notes on how the system works\r\n	\r\n	# cat=plugin.meta; type=string; label= Keywords: Enter a comma separated list of keywords.\r\n	keywords = TYPO3, introduction package, install, demo site, example setup, content management, enterprise\r\n\r\n	# cat=plugin.meta; type=string; label= Robots: Use for instance these codes: Index all pages: \"all\".  Index no pages: \"none\". Only this page: \"index,nofollow\".  Only subpages: \"noindex,follow\"\r\n	robots = all\r\n\r\n	# cat=plugin.meta; type=string; label= Copyright info: Enter copyright information, eg. \"Me Myself and I, 2001. All rights reserved.\"\r\n	copyright = typo3.org GPL\r\n\r\n	# cat=plugin.meta; type=string; label= Reply-to email\r\n	email = \r\n\r\n	# cat=plugin.meta; type=string; label= Author: Enter name of author.\r\n	author = T3UXW09 / typo3.org\r\n	\r\n	# cat=plugin.meta; type=int+; label= Revisit after: Number of days between search engine visits.\r\n	revisit = 7\r\n\r\n\r\n	# The meta tags below are not used on this website, if you want to use these, you can configure that in TypoScript template page.meta\r\n	\r\n	# cat=plugin.meta; type=boolean; label=Always include global.\r\n	includeGlobal = \r\n\r\n	# cat=plugin.meta; type=options[,Arabic=ar,Chinese=zh,Danish=dk,Dutch=nl,English=en,Finnish=fi,French=fr,German=de,Greek=el,Hebrew=he,Icelandic=is,Italian=it,Japanese=ja,Norwegian=no,Polish=pl,Portuguese=pt,Russian=ru,Spanish=es,Swedish=sv,Turkish=tr,Multi language=mul]; label= Language: Select language of the content.\r\n	language = en\r\n	\r\n	# cat=plugin.meta; type=string; label= Distribution\r\n	distribution = GLOBAL\r\n	\r\n	# cat=plugin.meta; type=options[,General,Mature,14 years,Restricted]; label= Rating\r\n	rating = General	\r\n}\r\n\r\nstyles.content {\r\n	# This defines the maximum width of images inserted in content records of type Images or Text-with-images.\r\n	# There are seperate settings for images floated next to text (..InText)\r\n	imgtext {\r\n		maxW = 651\r\n		maxWInText = 651\r\n		borderThick = 1\r\n		linkWrap.newWindow = 1\r\n	}\r\n	uploads {\r\n		jumpurl_secure = 1\r\n		jumpurl_secure_mimeTypes = pdf=application/pdf, doc=application/msword\r\n		jumpurl = 1\r\n	}\r\n}\r\n\r\ncontentpage {\r\n	# cat=contentpage; type=int+; label= Footer source PID: Parent ID of the footer record used on content pages.\r\n	footerPID = 20\r\n	\r\n	# cat=contentpage; type=int+; label= ID of the home page: ID of the home (root) page of the site.\r\n	homeID = 1\r\n\r\n	# cat=contentpage; type=int+; label= loginboxPID: ID of the folder containing the login box record (to be shown on multiple pages)\r\n	loginboxPID = 21\r\n\r\n	# cat=contentpage; type=int+; label= loginboxUID: UID of the login box record (to be shown on multiple pages)\r\n	loginboxUID = 31\r\n\r\n	# cat=contentpage; type=int+; label= loginpageID: UID of the customer login page.\r\n	loginpageID = 28\r\n	\r\n	# cat=contentpage; type=int+; label= examplelanguagesID: UID of the page which has the language menu enabled\r\n	examplelanguagesID = 25\r\n	\r\n	# cat=contentpage; type=string; label= language1: name of the default language of this site\r\n	language1 = English\r\n\r\n	# cat=contentpage; type=string; label= language2: name of the second language of this site\r\n	language2 = Dansk\r\n}\r\n\r\n# Set the language of meta tag with DC.language to Danish, when in Danish\r\n[globalVar = GP:L = 1]\r\nplugin.meta.language = da\r\n[global]\r\n','','','','','The ROOT template. \r\n\r\nThis template will be called by the \"Introduction Package\" template recored in the root page. It reads the root templates for every part, like page, menu, systemConfiguration and extensionConfiguration.\r\n','20,49,15,36,8',0,0,1,49),(58,9,0,0,0,'',0,0,0,0,0,1280484130,1024,1258456536,4,'plugin.indexed_search','',0,0,0,0,0,'','','# Configuration for indexedsearch plugin\r\n\r\nplugin.tx_indexedsearch {\r\n\r\n	templateFile = {$filepaths.extensiontemplates}indexed_search/tx_indexedsearch_pi1_template.html\r\n	forwardSearchWordsInResultLink = 0\r\n        show {        \r\n        	rules = 0\r\n        	advancedSearchLink = 0\r\n        }\r\n	search {\r\n		rootPidList =\r\n		exactCount = 1\r\n	}\r\n\r\n	_CSS_DEFAULT_STYLE >\r\n	_DEFAULT_PI_VARS {\r\n		results = 10\r\n	}\r\n}\r\n\r\n# Adjust search results when visitor has chosen another language\r\n[globalVar = GP:L = 1]\r\nplugin.tx_indexedsearch._DEFAULT_PI_VARS.lang = 1\r\n[global]\r\n','','','','The INDEXED_SEARCH template\r\nIndexed Search an extension for searching content in the frontend. \r\n\r\nFor a full description of the configuration options, check the manual of this extension. Extension manuals are normally included in the extensions as Open Office documents, and can be accessed directly from the module Ext Manager in the TYPO3 backend (select the option \'loaded extensions or install extension\'.\r\n\r\nFor the extension indexed search, the documentation is delivered in a separated extension with the extension key \'doc_indexed_search\', which is also provided with this Demo Package.','',0,0,0,0),(52,9,0,0,0,'',0,0,0,0,0,1258563143,768,1258299414,4,'plugin.felogin','',0,0,0,0,0,'','','plugin.tx_felogin_pi1 {\r\n	# Use our own HTML template from the fileadmin directory\r\n	# so we can freely modify it without changing the extension\r\n	templateFile = {$filepaths.extensiontemplates}felogin/tx_felogin_pi1_template.html\r\n	\r\n	# Clear default CSS additions - we take care of that in our own CSS files\r\n	_CSS_DEFAULT_STYLE =\r\n}\r\n','','','','The FELOGIN template\r\n\r\nThe felogin extension handles the login for access restricted frontend pages. It displays a form when the user is not logged in, a status when logged in and handles the login process.\r\n\r\nFor a full description of the configuration options, check the manual of this extension. Extension manuals are normally included in the extensions as Open Office documents, and can be accessed directly from the module Ext Manager in the TYPO3 backend (select the option \'loaded extensions or install extension\'.','',0,0,0,0),(51,9,0,0,0,'',0,0,0,0,0,1258303257,1000000000,1258298631,4,'plugin.realurl','',0,0,0,0,0,'','','config {\r\n	# Disable simulate static because it conflicts with realurl\r\n	simulateStaticDocuments = 0\r\n	\r\n	tx_realurl_enable = 0\r\n	uniqueLinkVars = 1\r\n	prefixLocalAnchors = all\r\n}\r\n','','','','Configuration for RealURL extension','',1,0,0,0),(54,9,0,0,0,'',0,0,0,0,0,1277199998,1280,1258382313,4,'plugin.tt_news','',0,0,0,0,0,'EXT:tt_news/pi/static/ts_new/','','plugin.tt_news {\r\n	templateFile = {$filepaths.extensiontemplates}tt_news/tx_ttnews_pi1_template.html\r\n	dontUseBackPid = 1\r\n	excludeAlreadyDisplayedNews = 0\r\n	noNewsToListMsg_stdWrap.wrap = <p>|</p>\r\n	\r\n	displaySingle {\r\n		subheader_stdWrap.wrap = <div class=\"news-single-subheader\">|</div>\r\n		image {\r\n			file.maxW = 250\r\n			file.maxH = 300\r\n			#imageLinkWrap = 0\r\n		}\r\n	}\r\n\r\n	# define rendering of LATEST mode\r\n	displayLatest {\r\n		subheader_stdWrap.cObject >\r\n		\r\n		subheader_stdWrap {\r\n			stripHtml = 1\r\n			crop = 70 | ... | 1\r\n			ifEmpty.field = bodytext\r\n			required = 1\r\n		}\r\n		/*\r\n		image {\r\n			file.maxW = 60\r\n			file.maxH = 60\r\n			imageLinkWrap = 0\r\n		}\r\n		*/\r\n	}\r\n\r\n	# rendering of LIST mode\r\n	displayList {\r\n		\r\n		subheader_stdWrap {\r\n			crop = 250 | ... | 1\r\n			required = 1\r\n			wrap >\r\n		}\r\n		content_stdWrap {\r\n			wrap = <div class=\"news-list-content\">|</div>\r\n			required = 1\r\n		}\r\n		image {\r\n			file.maxW = 175\r\n			file.maxH = 175\r\n			imageLinkWrap = 0\r\n		}\r\n\r\n	}\r\n\r\n	# Override some of the text labels for tt_news with our own text.\r\n	# See EXT:tt_news/pi/locallang.xml for all language labels\r\n	_LOCAL_LANG.default {\r\n		# Remove the header that tt_news adds by default above the LATEST listing\r\n		latestHeader =\r\n		\r\n		# replace the word \'more\' after article text in news list or latest with \'>>\'\r\n		more = >>\r\n	}\r\n\r\n	# Date & time formats for news display. The easiest way to change them is by changing the values\r\n	# of the constants in TypoScript template ROOT in the root folder of the TypoScript Templates.\r\n	# There are configuration options for various types of news display. If you want, you can modify\r\n	# each separately according to your own preferences.\r\n	\r\n	archiveTitleCObject {\r\n		10.strftime = %Y-%B\r\n	}\r\n	getRelatedCObject.10 {\r\n		default.20.strftime = {$plugin.tt_news.dateformat} {$plugin.tt_news.timeformat}\r\n		1.20.strftime = {$plugin.tt_news.dateformat} {$plugin.tt_news.timeformat}\r\n		2.20.strftime = {$plugin.tt_news.dateformat} {$plugin.tt_news.timeformat}\r\n	}\r\n	displaySingle {\r\n		date_stdWrap.strftime = {$plugin.tt_news.dateformat}\r\n		time_stdWrap.strftime = {$plugin.tt_news.timeformat}\r\n	}\r\n	displayLatest {\r\n		date_stdWrap.strftime = {$plugin.tt_news.dateformat}\r\n		time_stdWrap.strftime = {$plugin.tt_news.timeformat}\r\n	}\r\n	displayList {\r\n		date_stdWrap.strftime = {$plugin.tt_news.dateformat}\r\n		time_stdWrap.strftime = {$plugin.tt_news.timeformat}\r\n	}\r\n}','','','','The TT_NEWS template\r\n\r\nThe name says it all, this is a news plugin.\r\n\r\nFor a full description of the configuration options, check the manual of this extension. Extension manuals are normally included in the extensions as Open Office documents, and can be accessed directly from the module Ext Manager in the TYPO3 backend (select the option \'loaded extensions or install extension\'.','',0,0,0,0),(56,13,0,0,0,'',0,0,0,0,10,1258641618,640,1258385424,4,'menu.secondlevel','',0,0,0,0,0,'','','# This menu is slightly more complicated than the others because we copy our default menu again, but then we\'ll start overriding some settings from the default menu.\r\n# To get a full overview of the configuration of this menu you should look at both our default \'menu\' and the \'menu.secondlevel\' as shown below.\r\n# You can use the TypoScript Object Browser to view the end result of this.\r\n# (go to the Template module and select \'Typoscript Object Browser\' in the selectbox in the right frame.)\r\n\r\nmenu.secondlevel < menu\r\nmenu.secondlevel {\r\n	entryLevel = 1\r\n	\r\n	1 {\r\n		NO {\r\n			wrapItemAndSub = <li>|</li>\r\n		}\r\n		\r\n		# First clear the ATagParams setting of the ACT state because we are working with a copy of the object \'menu\'\r\n		# After that we add our modified configuration for menu.secondlevel\r\n		ACT {\r\n			ATagParams >\r\n			wrapItemAndSub = <li class=\"active\">|</li>\r\n		}\r\n\r\n		CUR {\r\n			ATagParams >\r\n			wrapItemAndSub = <li class=\"selected\">|</li>\r\n		}\r\n\r\n	}\r\n	\r\n	# Copy the configuration of the first level of this menu to level 2 and 3\r\n	2 < .1\r\n	3 < .1\r\n}','','','','The SECOND LEVEL MENU template.\r\n\r\nConfiguration for the menu of the sublevels of pages. It inherits the MAIN MENU template and has some small modifications on top of it, in this case the settings of the entryLevel. ','',0,0,0,43),(57,13,0,0,0,'',0,0,0,0,0,1258653358,896,1258409599,4,'menu.language','',0,0,0,0,0,'','','menu.language = HMENU\r\n\r\n# We use a condition to show the language menu only on the page with the id from constant contentpage.examplelanguagesID\r\n[globalVar = TSFE:id = {$contentpage.examplelanguagesID}]\r\n\r\nmenu.language {\r\n	special = language\r\n	special.value = 0,1\r\n	1 = TMENU\r\n	1 {\r\n		wrap = <ul>|</ul>\r\n		\r\n		# Remove the (old) default behaviour which adds onfocus=\"blurLink(this);\" to all links\r\n		noBlur = 1\r\n		\r\n		NO = 1\r\n		NO {\r\n			# Override the standard menu item value (which is the page title) with our own cObject\r\n			stdWrap.cObject = TEXT\r\n			\r\n			# Use the TypoScript option split function to display different values for the first and second item\r\n			stdWrap.cObject.value = {$contentpage.language1} || {$contentpage.language2}\r\n			allWrap = <li>|</li>\r\n		}\r\n		\r\n		ACT < .NO\r\n		ACT {\r\n			ATagParams = class=\"active\"\r\n		}\r\n	}\r\n}\r\n\r\n[global]\r\n','','','','The LANGUAGE menu\r\n\r\nGenerates a list of available languages on a page. If the page has no language overlay, there is no link available to switch to the language.','',0,0,0,0),(62,11,0,0,0,'',0,0,0,0,0,1277208666,768,1258476895,4,'lib.footer','',0,0,0,0,0,'','','# The method used here to fetch a record from a page or folder is slightly different from the one used \r\n# to fetch the loginbox in lib.contentleft\r\n# The method here doesn\'t refer to a specific record but takes the first record from the folder. This\r\n# has the advantage that an editor can delete the record and just create a new one, and it still works.\r\n/*\r\nlib.footer = CONTENT\r\nlib.footer {\r\n	table = tt_content\r\n	select {\r\n		orderBy = sorting\r\n		max = 1\r\n		pidInList = {$contentpage.footerPID}\r\n	}\r\n}\r\n*/\r\n\r\nlib.footer = COA\r\n\r\nlib.footer.10 < styles.content.getLeft\r\nlib.footer.10.select.pidInList = {$contentpage.footerPID}\r\nlib.footer.10.stdWrap.wrap = <div class=\"footerFrame\">|</div>\r\n\r\nlib.footer.20 < styles.content.get\r\nlib.footer.20.select.pidInList = {$contentpage.footerPID}\r\nlib.footer.20.stdWrap.wrap = <div class=\"footerFrame\">|</div>\r\n\r\nlib.footer.30 < styles.content.getRight\r\nlib.footer.30.select.pidInList = {$contentpage.footerPID}\r\nlib.footer.30.stdWrap.wrap = <div class=\"footerFrame-last\">|</div>\r\n','','','','lib.footer fetches the content record in \'Generated content > Footer content\' and displays that on all pages.','',0,0,0,0),(63,11,0,0,0,'',0,0,0,0,0,1258645191,640,1258484363,4,'lib.contentleft','',0,0,0,0,0,'','','lib.contentleft = COA\r\n\r\n# Insert the content from the left column into lib.contentleft\r\nlib.contentleft {\r\n	20 < styles.content.getLeft\r\n}','','','','TypoScript template which compiles the contents for the left column on the pages','',0,0,0,0),(64,11,0,0,0,'',0,0,0,0,63,1258655161,704,1258645083,4,'lib.contentright','',0,0,0,0,0,'','','lib.contentright = COA\r\n\r\n# The configuration below this condition will only be included on the page loginpageID, or on its subpages\r\n[PIDinRootline = {$contentpage.loginpageID}]\r\n\r\n# Insert a loginbox above the content (but below the menu) in the left column.\r\n# We fetch the loginbox record from the SysFolder \'Login Box\' under \'Generated content\'\r\n# There are different ways to do this, in lib.footer you will see a slightly different approach.\r\nlib.contentright {\r\n	10 = CONTENT\r\n	10 {\r\n		table = tt_content\r\n		select.pidInList = {$contentpage.loginboxPID}\r\n		select.uidInList = {$contentpage.loginboxUID}\r\n	}\r\n}\r\n\r\n# End of the conditional part\r\n[global]\r\n\r\n# In all other cases, get the content of the middle column and add it to the \'content\' part\r\nlib.contentright.20 < styles.content.getRight\r\n','','','','TypoScript template which compiles the contents for the right column on the pages','',0,0,0,0),(65,9,0,0,0,'',0,0,0,0,54,1280242394,1536,1280242156,12,'plugin.wt_spamshield','',0,0,0,0,0,'EXT:wt_spamshield/static/','','plugin.wt_spamshield {\r\n	enable.standardMailform = 1\r\n}','','','','The wt_spamshield template\r\n\r\nThis template enables the wt_spamshield extension for the standard mailform\r\n\r\nFor a full description of the configuration options, check the manual of this extension. Extension manuals are normally included in the extensions as Open Office documents, and can be accessed directly from the module Ext Manager in the TYPO3 backend (select the option \'loaded extensions or install extension\'.','',0,0,0,0);
