INSERT INTO tt_news VALUES (1,18,1276970586,1258389302,10,0,0,0,0,0,'','TYPO3 celebrates 20th anniversary',1497627180,'','','','',0,'TYPO3 celebrates it\'s 20th anniversary. Having been one of the very first Content Management Systems on the market 20 years of market leadership...','TYPO3 celebrates it\'s 20th anniversary. Having been one of the very first Content Management Systems on the market 20 years of market leadership is an achievement truly worth celebrating.\r\nLet\'s take a minute to reflect on the 20 years passed:\r\n1997: The idea for TYPO3 is born<br />2000: The TYPO3 community is born<br />2005: the first TYPO3 conference is held<br />2008: TYPO3 reaches a market share of close to 40% in central Europe<br />2010: TYPO3 5.0 shakes up the CMS world<br />2014: 95% of the world\'s websites run on Open Source and 60% on TYPO3<br />2017: Happy 20th Birthday TYPO3\r\nAll the TYPO3 enthusiasts in the world: Keep up the great work!','','',1,'','',0,0,'',1432504800,'',0,0,'a:19:{s:6:\"hidden\";N;s:4:\"type\";N;s:5:\"title\";N;s:5:\"short\";N;s:8:\"bodytext\";N;s:8:\"datetime\";N;s:11:\"archivedate\";N;s:6:\"author\";N;s:8:\"keywords\";N;s:5:\"image\";N;s:12:\"imagecaption\";N;s:12:\"imagealttext\";N;s:14:\"imagetitletext\";N;s:5:\"links\";N;s:10:\"news_files\";N;s:8:\"category\";N;s:7:\"related\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;}',0,0,0,0,'',0,0,0,0,0),(2,18,1272147458,1258389401,10,0,0,0,0,0,'','The TYPO3 Association is founded',1095348780,'','','','',0,'Months in the planning, on this very day the TYPO3 Association was founded by a group of long-time contributors headed by Kasper Skårhøj.','Months in the planning, on this very day the TYPO3 Association was founded by a group of long-time contributors headed by Kasper Skårhøj. The Association is located in Switzerland and will act as a heart of the project by funding development of the system\'s core, providing certficiation and representing the project officially. \r\n<b>Goals and Objectives</b><br /><br />\r\n<ul><li>Fostering development of TYPO3;</li><li>Organisation of events for the purpose of information and education of its members;</li><li>Supporting the adaption of international software standards within TYPO3;</li><li>Education and certification to ensure quality of service;</li><li>Communication with its members and the general public, to spread and further knowledge and proficiency for the usage of the TYPO3 software, especially by virtue of it’s project website;</li></ul>','','',1,'','',0,0,'',1432504800,'',0,0,'a:24:{s:6:\"hidden\";N;s:4:\"type\";N;s:5:\"title\";N;s:5:\"short\";N;s:8:\"bodytext\";N;s:10:\"no_auto_pb\";N;s:8:\"datetime\";N;s:11:\"archivedate\";N;s:6:\"author\";N;s:12:\"author_email\";N;s:8:\"keywords\";N;s:16:\"sys_language_uid\";N;s:5:\"image\";N;s:12:\"imagecaption\";N;s:12:\"imagealttext\";N;s:14:\"imagetitletext\";N;s:5:\"links\";N;s:10:\"news_files\";N;s:8:\"category\";N;s:7:\"related\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:8:\"fe_group\";N;s:8:\"editlock\";N;}',0,0,0,0,'',0,0,0,0,1),(3,18,1277202238,1258389405,10,0,0,0,0,0,'','T3UXW09 - The first TYPO3 User eXperience Week',1258389180,'team-t3uxw09_01.jpg','30 hand-picked specializists participating in the T3UXW09','','',0,'30 attendants for the T3UXW09 have arrived in rural Behringen (Germany) to work on TYPO3\'s usability for one whole week.','It is saturday the 14th of november. Almost everyone has arrived at the castle in Behringen at around 2-3 o\'clock in the afternoon. The castle is barrierfree, which means it is all adopted for disabled people. Although we are not working on accessibility I can safely assume most of the attendants support that. The castle itself is situated in a really nice rural environment. The air is really fresh. A welcome change for city dwellers. The whole castle belongs to the team this week. The network team, that rapidly volunteered, set up the whole wireless environment in a few hours. Punkt.de provided the switches they also use for the TYPO3 conferences. Joey brought a monster PC where he virtualised five servers. One for every team. Supportive tools like SVN, IRC and alike where all set up on this machine with the help of various people. Jens Hoffmann&nbsp;welcomed the attendants a little later in the afternoon and split up the available rooms among the attendants. After that the composition of the different teams was announced. ','','',1,'','',0,0,'',1432504800,'',0,0,'a:24:{s:6:\"hidden\";N;s:4:\"type\";N;s:5:\"title\";N;s:5:\"short\";N;s:8:\"bodytext\";N;s:10:\"no_auto_pb\";N;s:8:\"datetime\";N;s:11:\"archivedate\";N;s:6:\"author\";N;s:12:\"author_email\";N;s:8:\"keywords\";N;s:16:\"sys_language_uid\";N;s:5:\"image\";N;s:12:\"imagecaption\";N;s:12:\"imagealttext\";N;s:14:\"imagetitletext\";N;s:5:\"links\";N;s:10:\"news_files\";N;s:8:\"category\";N;s:7:\"related\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:8:\"fe_group\";N;s:8:\"editlock\";N;}',0,0,0,0,'',0,0,0,0,1),(4,18,1277202222,1258389409,10,0,0,0,0,0,'','TYPO3 - An idea is born',856629180,'kasper-skarhoj2_01.jpeg','TYPO3 Inventor: Kasper Skårhøj','','',0,'Kasper Skårhøj was contracted this week by a Danish company to build a content management solution for their corporate website. ','Kasper Skårhøj was contracted today by a Danish company this week to build a content management solution for their corporate website.&nbsp;The term &quot;Content Management&quot; is still widely unknown. The idea of content management is a straight forward solution to an emerging problem for the young internet - as websites are going to grow and the complexity of them increase, the need for separation of design and content has become  inevitable.\r\nOver the next months many meetings will define the exact requirements for this new system, enabling the client to manage the content on their website independant from HTML coders.\r\nStay tuned on what will help with this experiment.','','',1,'','',0,0,'',1432504800,'',0,0,'a:24:{s:6:\"hidden\";N;s:4:\"type\";N;s:5:\"title\";N;s:5:\"short\";N;s:8:\"bodytext\";N;s:10:\"no_auto_pb\";N;s:8:\"datetime\";N;s:11:\"archivedate\";N;s:6:\"author\";N;s:12:\"author_email\";N;s:8:\"keywords\";N;s:16:\"sys_language_uid\";N;s:5:\"image\";N;s:12:\"imagecaption\";N;s:12:\"imagealttext\";N;s:14:\"imagetitletext\";N;s:5:\"links\";N;s:10:\"news_files\";N;s:8:\"category\";N;s:7:\"related\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:8:\"fe_group\";N;s:8:\"editlock\";N;}',0,0,0,0,'',0,0,0,0,1),(7,18,1277112201,1277112142,11,0,0,0,0,0,'','Internal news item',1277111760,'','','','',0,'This news item has been categorized as \"Internal\"','This news item will only show up on pages displaying news from the category &quot;Internal&quot;. It is meant as part of a demonstration of the concept of front end user login.','','',1,'','',0,0,'',1432504800,'',0,0,'a:24:{s:6:\"hidden\";N;s:4:\"type\";N;s:5:\"title\";N;s:5:\"short\";N;s:8:\"bodytext\";N;s:10:\"no_auto_pb\";N;s:8:\"datetime\";N;s:11:\"archivedate\";N;s:6:\"author\";N;s:12:\"author_email\";N;s:8:\"keywords\";N;s:16:\"sys_language_uid\";N;s:5:\"image\";N;s:12:\"imagecaption\";N;s:12:\"imagealttext\";N;s:14:\"imagetitletext\";N;s:5:\"links\";N;s:10:\"news_files\";N;s:8:\"category\";N;s:7:\"related\";N;s:9:\"starttime\";N;s:7:\"endtime\";N;s:8:\"fe_group\";N;s:8:\"editlock\";N;}',0,0,0,0,'',0,0,0,0,0);
